  "inlineSchema": "// This is your Prisma schema file,\n// learn more about it in the docs: https://pris.ly/d/prisma-schema\n\ngenerator client {\n  provider = \"prisma-client-js\"\n}\n\ndatasource db {\n  provider = \"postgresql\"\n  url      = env(\"DATABASE_URL\")\n}\n\n// =================================\n// MODÈLE USER\n// =================================\nmodel User {\n  id            String  @id @default(uuid())\n  email         String  @unique\n  password      String\n  firstName     String\n  lastName      String\n  phone         String?\n  role          Role    @default(GUEST)\n  isActive      Boolean @default(true)\n  emailVerified Boolean @default(false)\n\n  // Relations\n  properties Property[]\n  bookings   Booking[]\n\n  // Métadonnées\n  createdAt   DateTime  @default(now())\n  updatedAt   DateTime  @updatedAt\n  lastLoginAt DateTime?\n\n  @@map(\"users\")\n}\n\nenum Role {\n  GUEST\n  OWNER\n  ADMIN\n}\n\n// =================================\n// MODÈLE PROPERTY (Propriété/Établissement)\n// =================================\nmodel Property {\n  id          String  @id @default(uuid())\n  name        String\n  description String? @db.Text\n  address     String\n  city        String\n  country     String\n  zipCode     String?\n  latitude    Float?\n  longitude   Float?\n\n  // Équipements et caractéristiques\n  amenities Json? // Liste des équipements (wifi, parking, etc.)\n  images    Json? // URLs des images\n\n  // Propriétaire\n  ownerId String\n  owner   User   @relation(fields: [ownerId], references: [id], onDelete: Cascade)\n\n  // Relations\n  units Unit[]\n\n  // Métadonnées\n  isActive  Boolean  @default(true)\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n\n  @@index([ownerId])\n  @@index([city])\n  @@map(\"properties\")\n}\n\n// =================================\n// MODÈLE UNIT (Unité/Appartement/Chambre)\n// =================================\nmodel Unit {\n  id          String   @id @default(uuid())\n  name        String\n  description String?  @db.Text\n  type        UnitType @default(APARTMENT)\n\n  // Capacité\n  maxGuests Int @default(2)\n  bedrooms  Int @default(1)\n  beds      Int @default(1)\n  bathrooms Int @default(1)\n\n  // Surface\n  surface Float? // en m²\n  floor   Int?\n\n  // Prix de base\n  basePrice   Float\n  cleaningFee Float? @default(0)\n\n  // Équipements spécifiques\n  amenities Json?\n  images    Json?\n\n  // Relation avec la propriété\n  propertyId String\n  property   Property @relation(fields: [propertyId], references: [id], onDelete: Cascade)\n\n  // Relations\n  bookings       Booking[]\n  calendarFeeds  CalendarFeed[]\n  availabilities Availability[]\n  rates          Rate[]\n\n  // Métadonnées\n  isActive  Boolean  @default(true)\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n\n  @@index([propertyId])\n  @@index([type])\n  @@map(\"units\")\n}\n\nenum UnitType {\n  APARTMENT\n  ROOM\n  STUDIO\n  HOUSE\n  VILLA\n}\n\n// =================================\n// MODÈLE BOOKING (Réservation)\n// =================================\nmodel Booking {\n  id String @id @default(uuid())\n\n  // Informations de réservation\n  checkIn   DateTime\n  checkOut  DateTime\n  numGuests Int\n\n  // Prix\n  totalPrice  Float\n  cleaningFee Float @default(0)\n  serviceFee  Float @default(0)\n\n  // Statut\n  status BookingStatus @default(PENDING)\n\n  // Notes\n  guestNotes String? @db.Text\n  ownerNotes String? @db.Text\n\n  // Source de la réservation\n  source     BookingSource @default(DIRECT)\n  externalId String? // ID de réservation externe (Airbnb, Booking.com, etc.)\n\n  // Relations\n  unitId String\n  unit   Unit   @relation(fields: [unitId], references: [id], onDelete: Cascade)\n\n  guestId String\n  guest   User   @relation(fields: [guestId], references: [id], onDelete: Cascade)\n\n  calendarEvents CalendarEvent[]\n\n  // Métadonnées\n  createdAt   DateTime  @default(now())\n  updatedAt   DateTime  @updatedAt\n  cancelledAt DateTime?\n\n  @@index([unitId])\n  @@index([guestId])\n  @@index([status])\n  @@index([checkIn, checkOut])\n  @@map(\"bookings\")\n}\n\nenum BookingStatus {\n  PENDING\n  CONFIRMED\n  CANCELLED\n  COMPLETED\n  NO_SHOW\n}\n\nenum BookingSource {\n  DIRECT\n  AIRBNB\n  BOOKING_COM\n  VRBO\n  HOMEAWAY\n  OTHER\n}\n\n// =================================\n// MODÈLE CALENDAR_FEED (Flux iCal)\n// =================================\nmodel CalendarFeed {\n  id       String  @id @default(uuid())\n  name     String\n  url      String // URL du flux iCal externe\n  source   String // airbnb, booking.com, vrbo, etc.\n  isActive Boolean @default(true)\n\n  // Relation avec l'unité\n  unitId String\n  unit   Unit   @relation(fields: [unitId], references: [id], onDelete: Cascade)\n\n  // Synchronisation\n  lastSyncAt DateTime?\n  syncStatus SyncStatus @default(PENDING)\n  syncError  String?    @db.Text\n\n  // Relations\n  events CalendarEvent[]\n\n  // Métadonnées\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n\n  @@index([unitId])\n  @@index([source])\n  @@map(\"calendar_feeds\")\n}\n\nenum SyncStatus {\n  PENDING\n  SUCCESS\n  ERROR\n}\n\n// =================================\n// MODÈLE CALENDAR_EVENT (Événement de calendrier)\n// =================================\nmodel CalendarEvent {\n  id String @id @default(uuid())\n\n  // Informations de l'événement\n  summary     String\n  description String?  @db.Text\n  startDate   DateTime\n  endDate     DateTime\n\n  // Lien avec la réservation interne (si existe)\n  bookingId String?\n  booking   Booking? @relation(fields: [bookingId], references: [id], onDelete: SetNull)\n\n  // Lien avec le flux iCal source\n  feedId String\n  feed   CalendarFeed @relation(fields: [feedId], references: [id], onDelete: Cascade)\n\n  // ID externe (UID de l'iCal)\n  externalId String?\n\n  // Métadonnées\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n\n  @@unique([feedId, externalId])\n  @@index([feedId])\n  @@index([bookingId])\n  @@index([startDate, endDate])\n  @@map(\"calendar_events\")\n}\n\n// =================================\n// MODÈLE AVAILABILITY (Disponibilité)\n// =================================\nmodel Availability {\n  id String @id @default(uuid())\n\n  // Période\n  startDate DateTime\n  endDate   DateTime\n\n  // Disponibilité\n  isAvailable Boolean @default(true)\n\n  // Règles spéciales\n  minNights Int?\n  maxNights Int?\n\n  // Relation avec l'unité\n  unitId String\n  unit   Unit   @relation(fields: [unitId], references: [id], onDelete: Cascade)\n\n  // Métadonnées\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n\n  @@index([unitId])\n  @@index([startDate, endDate])\n  @@map(\"availabilities\")\n}\n\n// =================================\n// MODÈLE RATE (Tarification)\n// =================================\nmodel Rate {\n  id String @id @default(uuid())\n\n  // Période\n  startDate DateTime\n  endDate   DateTime\n\n  // Prix\n  pricePerNight Float\n\n  // Type de tarif\n  type RateType @default(STANDARD)\n\n  // Description\n  name String?\n\n  // Relation avec l'unité\n  unitId String\n  unit   Unit   @relation(fields: [unitId], references: [id], onDelete: Cascade)\n\n  // Métadonnées\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n\n  @@index([unitId])\n  @@index([startDate, endDate])\n  @@map(\"rates\")\n}\n\nenum RateType {\n  STANDARD\n  WEEKEND\n  HOLIDAY\n  SEASON_HIGH\n  SEASON_LOW\n  SPECIAL\n}\n",
